  false,\n\t\"url\": null,\n\t\"notes\": \"Purchase Order commodity line level detail
  for City of Austin Commodities/Goods purchases dating back to October 1st, 2009.
  \ Each line includes the NIGP Commodity Code/COA Inventory Code, commodity description,
  quantity, unit of measure, unit price, total amount, referenced Master Agreement
  if applicable, the contract name, purchase order, award date, and vendor information.
  \ The data contained in this data set is for informational purposes only.  Certain
  Austin Energy transactions have been excluded as competitive matters under Texas
  Government Code Section 552.133 and City Council Resolution 20051201-002.\",\n\t\"license_title\":
